import React from 'react';
import logo from './logo.svg';
import './App.css';
// import './Register.css';


class Register extends React.Component {

constructor(props) {
    super(props);
    this.onSubmit = this.onSubmit.bind(this);
}

onSubmit(e) {
    e.preventDefault();
}

  render () {
    return (

      <div >
        <div>
        <h2 className="App">Log In</h2>

        <form onSubmit={this.onSubmit} className="projects fbca fbca--dircol fbca--flst">
            <div className="inputrow fbca">
                <label className="inputrow__description" htmlFor="username">Username</label>
                <input 
                    id="project-id" 
                    type="text" 
                    className="inputrow__field" 
                    name="username" />
            </div>

            <div className="inputrow fbca">
                <label className="inputrow__description" htmlFor="password">Password</label>
                <input 
                    id="password-id" 
                    type="password" 
                    className="inputrow__field" 
                    name="password" />
            </div>
            <div className="btn-group-submit">
                <button 
                id="get-userdata" 
                type="submit" 
                className="button"> Login </button>
                {/* <Link  className="btn btn-link">Register</Link> */}
            </div>

        </form>

        </div>
      </div>
    );
  }
}

export default Register;
